import React from 'react';

import { Container, ContainerPhoto, Title, PerfilPhoto, ContainerTechs, ContainerTechsLeft, ContainerTechsRight } from './styles';

import perfilPhoto from './img/perfil.png';

function Home() {

    return (
        <Container>

            <ContainerPhoto>
                <Title>BACKEND</Title>
                <PerfilPhoto src={perfilPhoto} />
                <Title>FRONTEND</Title>
            </ContainerPhoto>

            <ContainerTechs>
                <ContainerTechsLeft>
                    <h3></h3>
                </ContainerTechsLeft>

                <ContainerTechsRight>

                </ContainerTechsRight>
            </ContainerTechs>

        </Container>
    );
}

export default Home;
